                    CompanyTypeID = 1,
                    lvCompanyFilter = 3,
                    CompanyTypeID = 2,
                    lvCompanyFilter = 4,
                    CompanyTypeID = 3
                )
            )
        },
        ForAll(
            Sequence(CountRows(records)),
            Patch(
                Last(
                    FirstN(
                        records,
                        Value
                    )
                ),
                {rowNumber: Value}
            )
        )
    ),
    "CompanyName",
    SortOrder.Ascending,
    "rowNumber",
    SortOrder.Descending
)

